function dailyTemperatures2(temperatures: number[]): number[] {
  // monotonic decreasing stack, with this, every time we get a higher temperature, we'll pop current smaller elements
  // note that we will store indices (not temperatures)
  let monoDecStack: number[] = []
  let answer: number[] = Array(temperatures.length).fill(0)

  for (let i = 0; i < temperatures.length; i++) {
    while (monoDecStack.length > 0 && temperatures[monoDecStack[monoDecStack.length - 1]] < temperatures[i]) {
      const stackIndex = monoDecStack.pop()!
      answer[stackIndex] = (i - stackIndex)
    }
    monoDecStack.push(i)
  }

  return answer
};


// !Not Efficient
function dailyTemperatures(temperatures: number[]): number[] {
  let answer: number[] = []

  for (let i = 0; i < temperatures.length; i++) {
    let daysNeeded: number = 1

    for (let j = i + 1; j < temperatures.length; j++) {
      if (temperatures[i] < temperatures[j]) {
        answer.push(daysNeeded)
        break;
      }
      if (j == (temperatures.length - 1)) {
        answer.push(0);
        break;
      }
      daysNeeded++
    }
  }
  answer.push(0)  // last elemet is always '0'
  return answer
};

